import styled from "styled-components";

const Wrapper = styled.div`
  width: 100%;
  border-radius: 8px;
  box-shadow: 0px 0.45em 0px 0px #df6d6d;
  padding: 20px;
  background-color: white;
`;


const Form = () => {
  return(
    <Wrapper>
    </Wrapper>
  );
}

export default Form;
